The Youngstas

Witness the powerful Nathanial (Spider) Gibbs and Leon(Money) King! Two teenagers committing acts on the streets of South Carolina find themselves in a lot of trouble when they are wanted by the police, the feds and rival gangs across the state! Nathanial Gibbs and Leon King learn that the life of a gangster only ends up in two ways dead or in jail.

